// src/components/Lobby.js
import React, { useContext, useState, useEffect } from 'react';
import { GameContext } from '../context/GameContext';
import io from 'socket.io-client';

import piece1 from '../assets/pieces/piece1.png';
import piece2 from '../assets/pieces/piece2.png';
import piece3 from '../assets/pieces/piece3.png';
import piece4 from '../assets/pieces/piece4.png';
import piece5 from '../assets/pieces/piece5.png';
import piece6 from '../assets/pieces/piece6.png';
import piece7 from '../assets/pieces/piece7.png';
import piece8 from '../assets/pieces/piece8.png';

const socket = io('http://localhost:3001');

const pieceMap = {
  piece1,
  piece2,
  piece3,
  piece4,
  piece5,
  piece6,
  piece7,
  piece8
};
const allPieces = Object.keys(pieceMap);

const Lobby = () => {
  const { player, setPlayer, players, setPlayers, setGameState } = useContext(GameContext);
  const [name, setName] = useState('');
  const [selectedPiece, setSelectedPiece] = useState(null);
  const [readyList, setReadyList] = useState([]);

  useEffect(() => {
    socket.on('lobbyUpdate', setPlayers);
    socket.on('readyUpdate', setReadyList);
    socket.on('gameStart', () => setGameState('playing'));
    return () => {
      socket.off('lobbyUpdate');
      socket.off('readyUpdate');
      socket.off('gameStart');
    };
  }, [setPlayers, setGameState]);

  const handleJoin = () => {
    const trimmed = name.trim();
    if (!trimmed) return;
    const me = {
      name: trimmed,
      piece: null,
      ready: false,
      money: 1500,
      properties: [],
      tileId: 1
    };
    setPlayer(me);
    socket.emit('joinLobby', me);
  };

  const handleSelect = (key) => {
    setSelectedPiece(key);
    const updated = { ...player, piece: key };
    setPlayer(updated);
    socket.emit('selectPiece', { name: player.name, piece: key });
  };

  const handleReady = () => {
    socket.emit('playerReady', player.name);
  };

  const used = players.map(p => p.piece).filter(Boolean);
  const available = allPieces.filter(p => !used.includes(p));
  const allReady = players.length >= 2 && players.every(p => p.piece && readyList.includes(p.name));

  return (
    <div style={{
      display: 'flex', flexDirection: 'column',
      alignItems: 'center', justifyContent: 'center',
      height: '100vh', fontSize: '1.2rem'
    }}>
      <h2>Monopoly Lobby</h2>

      {!player && (
        <>
          <input
            placeholder="Enter your name"
            value={name}
            onChange={e => setName(e.target.value)}
            style={{ marginBottom: 10 }}
          />
          <button onClick={handleJoin}>Join Lobby</button>
        </>
      )}

      {player && !selectedPiece && (
        <>
          <p>Select your game piece:</p>
          <div style={{ display: 'flex', gap: 10 }}>
            {available.map(p => (
              <img
                key={p}
                src={pieceMap[p]}
                alt={p}
                width={60}
                style={{ cursor: 'pointer' }}
                onClick={() => handleSelect(p)}
              />
            ))}
          </div>
        </>
      )}

      {selectedPiece && !readyList.includes(player.name) && (
        <button onClick={handleReady} style={{ marginTop: 20 }}>I'm Ready</button>
      )}

      <hr style={{ width: '60%', margin: '2rem 0' }} />

      <h3>Players in Lobby ({players.length})</h3>
      <ul style={{ listStyle: 'none', padding: 0 }}>
        {players.map((p, i) => (
          <li key={i} style={{ marginBottom: 6 }}>
            {p.name}{' '}
            {p.piece && (
              <img src={pieceMap[p.piece]} alt={p.piece} width={20} style={{ verticalAlign: 'middle' }} />
            )}{' '}
            {readyList.includes(p.name) && <span>✅</span>}
          </li>
        ))}
      </ul>

      {allReady && <p style={{ color: 'green' }}>All players ready — starting game…</p>}
    </div>
  );
};

export default Lobby;
